import {
  Box,
  createTheme,
  Grid2,
  Paper,
  TextField,
  ThemeProvider,
} from "@mui/material";
import React from "react";

const ProductDetails = ({ data, handler, theme }) => {
  const darkTheme = createTheme({ palette: { mode: "dark" } });

  return (
    <>
      <ThemeProvider theme={darkTheme}>
        <Paper
          elevation={6}
          sx={{
            alignSelf: "center",
            textAlign: "center",
            width: 90,
            height: 60,
            lineHeight: "60px",
          }}
        >
          Product Details
        </Paper>
      </ThemeProvider>
      <Grid2
        size={12}
        sx={{ justifyContent: "center", paddingTop: "2%" }}
        container
        spacing={3}
      >
        <TextField
          id="filled-multiline-flexible"
          label="Product description"
          name="description"
          multiline
          maxRows={4}
          variant="filled"
          onChange={(e) =>
            handler({ ...data, [e.target.name]: e.target.value })
          }
        />
        <TextField
          id="filled-multiline-flexible"
          label="Impact to be acheieved"
          name="impact"
          multiline
          maxRows={4}
          variant="filled"
          onChange={(e) =>
            handler({ ...data, [e.target.name]: e.target.value })
          }
        />
      </Grid2>
    </>
  );
};

export default ProductDetails;
